Latin Adultery  ella- Milano

Actors: Ella Milano , Bill Bailey

Release Date: October 22, 2010

Ella comes over to her new neighbor's place with a gift of her famous casserole. It seems the new neighbor is still waiting to start his new job and has nothing to do all day. Ella's husband works all the time, and so she is bored during the day as well. If they are both going to be home during the day, they might as well be good friends......with benefits.

